import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import 'bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min';


const TambahUser = () => {

  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [gender, setGender] = useState("Laki laki");
  const [kelas, setClass] = useState("");
  const [telepon, setPhone] = useState("");

  const navigate = useNavigate();

  const simpanPengguna = async(e) => {
    e.preventDefault();
    try {
      await axios.post('http://localhost:5000/pengguna',{
          name,
          email,
          gender,
          kelas,

      });
    } catch (error) {
      
    }
  }
  return (
    <>
    <main className='p-5 bg-dark'>
    <div className='position-relative m-5'>
      {/* form  */}
      <form onSubmit={simpanPengguna}>
      <div className='container-fluid'>
        {/* nama */}
      <div class="input-group mb-3">
        <span class="input-group-text" id="basic-addon1">@</span>
        <input 
        type="text" 
        value={name} 
        onChange={(e)=> setName(e.target.value)}
        className="form-control" 
        placeholder="Nama lengkap" 
        aria-label="Username" 
        aria-describedby="basic-addon1"
        />
      </div>
      {/* ./nama */}
      {/* email */}
      <div class="mb-3">
        <label for="exampleFormControlInput1" className="form-label">Email address</label>
        <input
        value={email} 
        onChange={(e)=> setEmail(e.target.value)} 
        type="email" 
        className="form-control" 
        id="exampleFormControlInput1" 
        placeholder="nama@gmail.com" />
      </div>
      {/* ./email */}
      {/* gender */}
      <label for="GenderDataList" className="form-label">Jenis Kelamin</label>
        <input 
        className="form-control" 
        value={gender} 
        onChange={(e)=> setGender(e.target.value)} 
        list="datalistGender" 
        id="GenderDataList" 
        placeholder="gender" 
        />
        <datalist id="datalistGender">
          <option value="Laki laki"/>
          <option value="Perempuan"/>
        </datalist>
      {/* ./gender */}
      {/* kelas */}
      <label for="JurusanDataList" className="form-label">Jurusan/Kelas</label>
        <input 
        className="form-control" 
        value={kelas} 
        onChange={(e)=> setClass(e.target.value)} 
        list="datalistJurusan" 
        id="JurusanDataList" 
        placeholder="Jurusan" 
        />
        <datalist id="datalistJurusan">
          <option value="Informatika A"/>
          <option value="Informatika B"/>
          <option value="Informatika C"/>
          <option value="Informatika D"/>
          <option value="Informatika E"/>
          <option value="Informatika F"/>
        </datalist>
      {/* ./kelas */}
       {/* telepon */}
       <div class="input-group mb-3">
        <span class="input-group-text" id="basic-addon1">No. Handphone</span>
        <input 
        type="phone" 
        value={telepon} 
        onChange={(e)=> setPhone(e.target.value)}
        className="form-control" 
        placeholder="Telepon" 
        aria-label="Username" 
        aria-describedby="basic-addon1"
        />
      </div>
      {/* telepon */}
      </div>
      </form>
      {/* ./form */}
    </div>
    </main>
    </>
  )
}

export default TambahUser;
